import React, { useState } from "react";
import {
  Container,
  Typography,
  Box,
  Button,
  Radio,
  RadioGroup,
  FormControlLabel,
  FormControl,
  FormLabel,
  Checkbox
} from "@material-ui/core";

import "./ProductFinder.css";
import { calculatePlan } from "./scoring";

const ProductFinder = () => {

  const [answers, setAnswers] = useState({
    employeeSize: 0,
    branches: 0,
    payrollSystem: 0,
    workerTypes: [],
    features: 0,
    reports: 0,
    approvals: 0,
    selfService: 0,
    support: 0,
  });

  const [result, setResult] = useState(null);

  const handleWorkerType = (label, score) => {
    const exists = answers.workerTypes.find(w => w.label === label);

    if (exists) {
      setAnswers({
        ...answers,
        workerTypes: answers.workerTypes.filter(w => w.label !== label)
      });
    } else {
      setAnswers({
        ...answers,
        workerTypes: [...answers.workerTypes, { label, score }]
      });
    }
  };

  const handleSubmit = () => {
    const outcome = calculatePlan(answers);
    setResult(outcome);
  };

  return (
    <Container className="finder-container">

      <Typography variant="h3" gutterBottom>
        UlapPayroll Product Finder
      </Typography>

      {/* SECTION 1 */}
      <Box className="section">
        <FormControl>
          <FormLabel>How many employees do you have?</FormLabel>
          <RadioGroup onChange={(e) => setAnswers({ ...answers, employeeSize: Number(e.target.value) })}>
            <FormControlLabel value={1} control={<Radio />} label="1-20" />
            <FormControlLabel value={2} control={<Radio />} label="21-50" />
            <FormControlLabel value={3} control={<Radio />} label="50-150" />
            <FormControlLabel value={4} control={<Radio />} label="151+" />
          </RadioGroup>
        </FormControl>
      </Box>

      {/* WORKER TYPES */}
      <Box className="section">
        <FormLabel>What types of workers do you pay?</FormLabel>

        <FormControlLabel
          control={<Checkbox onChange={() => handleWorkerType("Fixed Monthly Employees", 1)} />}
          label="Fixed Monthly Employees"
        />

        <FormControlLabel
          control={<Checkbox onChange={() => handleWorkerType("Daily Wage Employees", 2)} />}
          label="Daily Wage Employees"
        />

        <FormControlLabel
          control={<Checkbox onChange={() => handleWorkerType("Project-Based Employees", 2)} />}
          label="Project-Based Employees"
        />

        <FormControlLabel
          control={<Checkbox onChange={() => handleWorkerType("Field / Remote Employees", 3)} />}
          label="Field / Remote Employees"
        />

        <FormControlLabel
          control={<Checkbox onChange={() => handleWorkerType("Mixed Compensation Staff", 3)} />}
          label="Mixed Compensation Staff"
        />
      </Box>

      <Button
        variant="contained"
        color="primary"
        onClick={handleSubmit}
      >
        Get Recommendation
      </Button>

      {result && (
        <Box className="result-card">
          <Typography variant="h4">
            Recommended Plan: {result.recommendation.plan}
          </Typography>
          <Typography variant="h6">
            Price: {result.recommendation.price}
          </Typography>
          <Typography>
            Total Score: {result.total}
          </Typography>
          <Button
            variant="contained"
            color="secondary"
            className="checkout-btn"
          >
            Proceed to Checkout
          </Button>
        </Box>
      )}

    </Container>
  );
};

export default ProductFinder;
